package test.jmul.math.numbers;


import java.math.BigDecimal;

import java.util.ArrayList;
import java.util.Collection;

import jmul.math.numbers.RealDecimalNumber;

import static org.junit.Assert.assertEquals;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.junit.runners.Parameterized;


/**
 * This test suite tests instantiation of a real number with big integer values.
 *
 * @author Kristian Kutin
 */
@RunWith(Parameterized.class)
public class RealNumberInstantiationWithBigDecimalTest {

    /**
     * The actual input.
     */
    private final BigDecimal input;

    /**
     * The expected string representation.
     */
    private final String expectedOutput;

    /**
     * Creates a new test case according to the specified parameters.
     *
     * @param anInput
     * @param theExpectedOutput
     */
    public RealNumberInstantiationWithBigDecimalTest(BigDecimal anInput, String theExpectedOutput) {

        input = anInput;
        expectedOutput = theExpectedOutput;
    }

    /**
     * Tests the instantiation and the generation of a string representation (i.e. standard notation).
     */
    @Test
    public void testInstantiationAndStringRepresentation() {

        String message = String.format("Test failed for %s!", input);

        RealDecimalNumber number = new RealDecimalNumber(input);
        assertEquals(message, expectedOutput, number.toStandardNotation());
        assertEquals(message, expectedOutput, number.toString());

        assertEquals(message, false, number.isInfinity());

        if (StringHelper.isNegative(input.toString())) {

            assertEquals(message, false, number.isPositive());
            assertEquals(message, true, number.isNegative());

        } else {

            assertEquals(message, true, number.isPositive());
            assertEquals(message, false, number.isNegative());
        }

        int expectedDigitCount = StringHelper.digits(input.toString());
        int expectedLeftDigitCount = StringHelper.digitsLeft(input.toString());
        int expectedRightDigitCount = StringHelper.digitsRight(input.toString());
        int actualDigitCount = number.digits();
        int actualLeftDigitCount = number.leftDigits();
        int actualRightDigitCount = number.rightDigits();
        assertEquals(message, expectedDigitCount, actualDigitCount);
        assertEquals(message, expectedLeftDigitCount, actualLeftDigitCount);
        assertEquals(message, expectedRightDigitCount, actualRightDigitCount);
    }

    /**
     * Returns a matrix of test data and expected results.
     *
     * @return a matrix of test data and expected results
     */
    @Parameterized.Parameters
    public static Collection<Object[]> data() {

        Collection<Object[]> parameters = new ArrayList<Object[]>();

        parameters.add(new Object[] { new BigDecimal("0"), "0" });

        parameters.add(new Object[] { new BigDecimal("12345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890"),
                                      "12345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890" });
        parameters.add(new Object[] { new BigDecimal(""),
                                      "" });
        parameters.add(new Object[] { new BigDecimal(""),
                                      "" });
        parameters.add(new Object[] { new BigDecimal(""),
                                      "" });
        parameters.add(new Object[] { new BigDecimal(""),
                                      "" });
        parameters.add(new Object[] { new BigDecimal(""),
                                      "" });
        parameters.add(new Object[] { new BigDecimal(""),
                                      "" });

        parameters.add(new Object[] { new BigDecimal("0.1234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789"),
                                      "0.1234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789" });
        parameters.add(new Object[] { new BigDecimal("0."),
                                      "0." });
        parameters.add(new Object[] { new BigDecimal("0."),
                                      "0." });
        parameters.add(new Object[] { new BigDecimal("0."),
                                      "0." });
        parameters.add(new Object[] { new BigDecimal("0."),
                                      "0." });
        parameters.add(new Object[] { new BigDecimal("0."),
                                      "0." });
        parameters.add(new Object[] { new BigDecimal("0."),
                                      "0." });

        parameters.add(new Object[] { new BigDecimal("-0.1234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789"),
                                      "-0.1234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789012345678901234567890123456789" });
        parameters.add(new Object[] { new BigDecimal("-0."),
                                      "-0." });
        parameters.add(new Object[] { new BigDecimal("-0."),
                                      "-0." });
        parameters.add(new Object[] { new BigDecimal("-0."),
                                      "-0." });
        parameters.add(new Object[] { new BigDecimal("-0."),
                                      "-0." });
        parameters.add(new Object[] { new BigDecimal("-0."),
                                      "-0." });
        parameters.add(new Object[] { new BigDecimal("-0."),
                                      "-0." });

        return parameters;
    }

}
